import { useState, useEffect } from "react";
 
function Fetchdata() {
 
  const [data, setData] = useState(null);
  const [error, setError] = useState("");
 
  useEffect(() => {
       fetch("http://localhost:3000/users")
      .then(response => {
       response.json()
      }) 
      .then(data => {
       setData(data)
       console.log(data)
       }) 
      .catch(err=> {
        setError(error);
    })
    }, []);
    
 
  return (
   
    <div>{data && data.length && data.map((item)=>{
      return(
          <>
          <span>{item.name}</span>
          <span>{item.id}</span>
          <span>{item.profession}</span>
          <span>{item.role}</span>
          </>
      )
  })}</div>
   
  )
}
 export default Fetchdata;
